import {Navbar, Nav} from 'react-bootstrap'
import {Link} from 'react-router-dom'

function Header() {
    return (
      <div>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Link to="/add">  </Link>
            <Link to="/update">  </Link>
            <Link to="/login">  </Link>
            <Link to="/">  </Link>
          </Nav>
        </Navbar>
      </div>
    );
 
}

export default Header;
